const BikeIconImages = [
  // eslint-disable-next-line no-undef
  { imageId: 1, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_Cross-Gravelbike.svg', type: 'Gravel Bike'},
  // eslint-disable-next-line no-undef
  { imageId: 2, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_Herrenrad.svg', type: 'Klapprad' },
  // eslint-disable-next-line no-undef
  { imageId: 3, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_Rennrad.svg', type: 'Racing Bike'},
  // eslint-disable-next-line no-undef
  { imageId: 4, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_MTB-Hardtail.svg', type: 'Mountain Bike'},
  // eslint-disable-next-line no-undef
  { imageId: 5, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_Herrenrad.svg', type: 'Trekking Bike' },
  // eslint-disable-next-line no-undef
  { imageId: 6, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_Herrenrad.svg', type: 'City Bike' },
  // eslint-disable-next-line no-undef
  { imageId: 7, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_MTB-Hardtail.svg', type: 'E-Bike' },
  // eslint-disable-next-line no-undef
  { imageId: 8, src: process.env.PUBLIC_URL + '/Icon_Fahrradtyp_Cross-Gravelbike.svg', type: 'Cross Bike' },
];

export default BikeIconImages;
